INSERT INTO `oa_notify` VALUES (123, 1, 'MongoDB4.2发布', '<p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\"><img height=\"210\" src=\"https://oscimg.oschina.net/oscnet/16ab3ae3a6596756e1fe6b22e8d74340ec8.jpg\" width=\"721\" class=\"zoom-in-cursor\" style=\"margin: auto; max-width: 80%; cursor: zoom-in; height: auto !important;\"></p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\">MongoDB 4.2 正式发布了，MongoDB Server 4.2 提高了现代事务和分析数据平台的技术水平。&nbsp;4.2 的主要重点包括：</p><ul style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 2.5em; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\"><li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-weight: 700;\">分布式事务</span>将 MongoDB 的多文档 ACID 从副本集扩展到共享集群，能够为更广泛的用例服务</li><li style=\"box-sizing: inherit; margin-top: 0.25em;\"><span style=\"box-sizing: inherit; font-weight: 700;\">按需物化视图</span>使用新的 $Merge 运算符，在集合中缓存大型聚合的输出是一种常见的模式，新的 $Merge 运算符将可以有效地更新这些结果，而不是完全重新计算它们</li><li style=\"box-sizing: inherit; margin-top: 0.25em;\"><span style=\"box-sizing: inherit; font-weight: 700;\">通配符索引</span>使建模像产品目录这样的高度异构的集合变得简单和自然，而不牺牲对索引的支持。只需定义一个过滤器，它将自动索引集合中所有匹配的字段、子文档和数组</li><li style=\"box-sizing: inherit; margin-top: 0.25em;\"><span style=\"box-sizing: inherit; font-weight: 700;\">MongoDB 查询语言增强功能</span>，如更有表现力的更新、新的数学运算符和扩展的 regex 支持。此版本的 update&nbsp;和 findAndModify 命令可以引用现有字段，并加入聚合管道，以获得更强的表现力</li><li style=\"box-sizing: inherit; margin-top: 0.25em;\"><span style=\"box-sizing: inherit; font-weight: 700;\">可还原读写</span>，降低了编写处理临时集群故障的代码的复杂性</li></ul>', NULL, 1, 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-20 07:13:06', '2019-08-20 07:13:06', 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-24 09:46:41', '测试', '0');
