INSERT INTO `oa_notify` VALUES (128, 1, 'RUOYI', '<blockquote style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; font-size: 15px; border-left: 4px solid var(--theme-color,#42b983); color: rgb(133, 133, 133); margin-top: 2em; margin-bottom: 2em; font-family: &quot;Source Sans Pro&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif;\"><p style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; margin-top: 1.2em; margin-bottom: 1.2em; line-height: 1.6rem; word-spacing: 0.05rem; font-weight: 600;\">一直想做一款后台管理系统，看了很多优秀的开源项目但是发现没有合适的。于是利用空闲休息时间开始自己写了一套后台系统。如此有了若依。</p></blockquote><p style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; font-size: 15px; margin-top: 1.2em; margin-bottom: 1.2em; line-height: 1.6rem; word-spacing: 0.05rem; color: rgb(52, 73, 94); font-family: &quot;Source Sans Pro&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">RuoYi从3.0开始，进行模块拆分，将原先的单应用转变为多模块，如需单应用，请移步&nbsp;<a href=\"https://gitee.com/y_project/RuoYi-fast\" target=\"_blank\" style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; color: var(--theme-color,#42b983); font-weight: 600;\">RuoYi-fast</a>&nbsp;<code style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; border-radius: 2px; color: rgb(233, 105, 0); font-size: 0.8rem; margin: 0px 2px; padding: 3px 5px; white-space: pre-wrap; background-color: rgb(248, 248, 248); font-family: &quot;Roboto Mono&quot;, Monaco, courier, monospace;\">(保持同步更新)</code>，如需其他版本，请移步&nbsp;<a href=\"http://doc.ruoyi.vip/#/standard/xmkz\" target=\"_blank\" style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; color: var(--theme-color,#42b983); font-weight: 600;\">项目扩展</a>&nbsp;<code style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; border-radius: 2px; color: rgb(233, 105, 0); font-size: 0.8rem; margin: 0px 2px; padding: 3px 5px; white-space: pre-wrap; background-color: rgb(248, 248, 248); font-family: &quot;Roboto Mono&quot;, Monaco, courier, monospace;\">(不定时更新)</code></p><p style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; font-size: 15px; margin-top: 1.2em; margin-bottom: 1.2em; line-height: 1.6rem; word-spacing: 0.05rem; color: rgb(52, 73, 94); font-family: &quot;Source Sans Pro&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif;\"><img src=\"http://localhost:8082/crowdfounding-web/upload/2019/08/22/dd7755c9a04f670f179b2506451817e9.jpg\" data-filename=\"2019/08/22/dd7755c9a04f670f179b2506451817e9.jpg\" style=\"width: 50%;\"><code style=\"-webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; border-radius: 2px; color: rgb(233, 105, 0); font-size: 0.8rem; margin: 0px 2px; padding: 3px 5px; white-space: pre-wrap; background-color: rgb(248, 248, 248); font-family: &quot;Roboto Mono&quot;, Monaco, courier, monospace;\"><br></code></p>', NULL, 1, 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-21 03:41:10', '2019-08-21 03:41:10', 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-24 06:19:35', '', '0');
INSERT INTO `oa_notify` VALUES (129, 1, 'GraalVM 19.2 发布', '<p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\">GraalVM 19.2&nbsp;发布了。GraalVM 是高性能跨语言虚拟机，用于运行 JavaScript、Python 3、Ruby、R、基于 JVM 的语言，如 Java、Scala、Kotlin 和基于 LLVM 的语言，如 C 和 C++。</p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\">该版本带来了改进的配置文件引导的优化、包括 LLVM 工具链、带有 Java Flight Recorder&nbsp;支持的增强的 VisualVM、新的 Visual Studio Code 预览插件、更好的本机图像峰值性能等等。</p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: 700;\">配置文件引导的优化</span></p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\">在 JVM 上运行的 GraalVM JIT 模式适合高峰值性能，因为它能够在启动期间收集运行时信息，并使用它优化机器代码。GraalVM AOT 模式在启动时和内存消耗方面都很好，但由于缺少运行时信息而提供了较低的峰值性能。</p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\">为了缓解这种情况，GraalVM 团队为 GraalVM 企业版实现了概要文件引导的优化(PGO，&nbsp;profile-guided optimizations&nbsp;)。使用 PGO，可以预先收集分析数据，然后将其提供给 GraalVM 本机映像实用程序，后者将使用这些信息优化生成的二进制文件的性能。</p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px; color: rgb(51, 51, 51); font-family: &quot;Pingfang SC&quot;, STHeiti, &quot;Lantinghei SC&quot;, &quot;Open Sans&quot;, Arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, SimSun, sans-serif; font-size: 16px;\">从 19.2 开始，可以在编译的模式下运行应用程序时为 PGO 收集数据：</p><pre style=\"box-sizing: inherit; word-break: initial; overflow-wrap: initial; margin-top: 16px; margin-bottom: 14px; padding: 14px 15px 12px; border-radius: 3px; border-width: initial; border-style: none; border-color: initial; line-height: 1.6; background: rgb(246, 246, 246);\"><code class=\"hljs shell\" style=\"box-sizing: inherit; font-size: 13px; display: block; background: rgb(246, 246, 246); color: rgb(51, 51, 51); margin: 0px; border-radius: 3px; overflow: visible; line-height: 1.6;\"><span class=\"hljs-meta\" style=\"box-sizing: inherit; color: rgb(106, 115, 125);\">$</span><span class=\"bash\" style=\"box-sizing: inherit;\"> /graal-ee-19.2.0/bin/java -Dgraal.PGOInstrument=myclass.iprof MyClass</span>\r\n<span class=\"hljs-meta\" style=\"box-sizing: inherit; color: rgb(106, 115, 125);\">$</span><span class=\"bash\" style=\"box-sizing: inherit;\"> /graal-ee-19.2.0/bin/native-image --pgo=myclass.iprof MyClass</span>\r\n<span class=\"hljs-meta\" style=\"box-sizing: inherit; color: rgb(106, 115, 125);\">$</span><span class=\"bash\" style=\"box-sizing: inherit;\"> ./myclass</span></code></pre>', NULL, 1, 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-23 06:37:40', '2019-08-23 06:36:54', NULL, NULL, '', '1');
INSERT INTO `oa_notify` VALUES (130, 1, 'GraalVM 19.2 发布', '<p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px;\"><span style=\"font-family: &quot;Arial Black&quot;;\">GraalVM 19.2&nbsp;发布了。GraalVM 是高性能跨语言虚拟机，用于运行 JavaScript、Python 3、Ruby、R、基于 JVM 的语言，如 Java、Scala、Kotlin 和基于 LLVM 的语言，如 C 和 C++。</span></p><p style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px;\"><span style=\"font-family: &quot;Arial Black&quot;;\">该版本带来了改进的配置文件引导的优化、包括 LLVM 工具链、带有 Java Flight Recorder&nbsp;支持的增强的 VisualVM、新的 Visual Studio Code 预览插件、更好的本机图像峰值性能等等。</span></p><h3 style=\"box-sizing: inherit; margin-top: 16px; margin-bottom: 14px; line-height: 28px;\"><span style=\"box-sizing: inherit;\"><b>配置文件引导的优化</b></span></h3>', NULL, 1, 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-23 06:39:55', '2019-08-23 06:39:55', 'c79ba431f9f74dfbae585b87b0cde933', '2019-08-24 09:11:59', '123', '0');
